script: |
  super -f text -I q675.spq | sort > q675.out

inputs:
  - name: q675.spq
    data: |
      SELECT - - COUNT ( * ) AS col1, MIN ( + - 84 ) / + - 71 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q675.out
    data: |
      9	1
